    true,nt"url": null,nt"notes": "The National Assessment of Educational Progress,
    2004 Long-Term Trend Study (NAEP 2004 LTT), is a study that is part of the National
    Assessment of Educational Progress (NAEP) program; program data is available since
    1971 at http://nces.ed.gov/nationsreportcard/naepdata/. NAEP 2004 LTT (http://nces.ed.gov/nationsreportcard/ltt)
    is a cross-sectional survey that assesses what America's students know and can do
    in reading and mathematics. NAEP 2004 LTT was administered to students aged 9, 13,
    and 17 who were enrolled in public and private elementary and secondary schools
